import Person from '../models/person.js'
function NavBar() {

  function createAPerson(name, hairColor, hasGlasses, shirtColor, hasFacialHair, department, job){
    return new Person(name, hairColor, hasGlasses, shirtColor, hasFacialHair, department, job)
  }

  return (
    <>
    <ul>
      <li><a> </a></li>
      <button>Make a person!</button>
    </ul>
    </>
  )
};

export default NavBar;
